import { useState } from "react";
import NavBar from "./Header/NavBar";
import Main from "./Body/Main";

export default function App() {
  const [movies, setMovies] = useState(tempMovieData);
  return (
    <>
      <NavBar />
      <Main movies={movies} />
    </>
  );
}
